import React from 'react';
import axios from 'axios';

import './App.css';

class App extends React.Component {
  state = { isLoaded: false, models: [] };

  componentDidMount() {
    fetch('http://127.0.0.1:8001/api/products', { mode: 'no-cors', headers: {'Content-Type': 'application/json'} })
      .then(res => {
        console.log(res);
        if (res.ok) {
          return res.json();
        } else {
          throw Error(res.statusText);
        }
      })
      .then(json => {
        this.setState({
          models: json.results,
          isLoaded: true
        });
      })

      .catch(function(e){
        console.log(e);

  })
}

  render() {
    const {models } = this.state;

    return <div>{models.map(model => <div key={model.id}>{model.code}</div>)}</div>;
  }
}

export default App;
